import React, { Component } from 'react';

//body structure css
import './App.css';

import './Register.css';

class Register extends Component {
    render(){
        return(
            <div id='app'>
                <div id='topContainer'>
                    <div id='logoContainer'>
                        <p><span id='firstPartLogo'>Tudor</span><span>Flix</span></p>
                    </div>
                    <div id='signUpLinkContainer'>

                    </div>
                </div>
            </div>
        )
    }
}

export default Register;
